module.exports = {
  entry: './client/main.js',
  output: {
    filename: 'bundle.js'
  },
  devtool: 'source-map',
  module: {
    loaders: [
      {
        test: /\.js$/,
        exclude: /node_modules/,
        loaders: ['babel-preset-stage-0', 'babel-preset-react']
      }
    ]
  }
};
